// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "./KennyCoin.sol";

contract TokenWrapper {
  KennyCoin kennyCoin;
  mapping(address => mapping(address => uint256)) public allowed;

  // accept only ETH
  address internal constant ETH_ADDRESS = address(0x1); // Address for tokens representing Ether is 0x00...01

  function wrap(
    address target,
    address token,
    uint256 amount
  ) public payable {
    // check if token is ETH
    require(token == ETH_ADDRESS, "Token is not ETH");

    // check if the amount is correct, msg.value for eth
    require(msg.value == amount, "Amount does not match");

    // mint token to the target
    kennyCoin.transferFrom(address(this), target, amount / 2);
  }

  function unwrap(address target, uint256 amount) public payable {
    // burn the token
    kennyCoin.transferFrom(target, address(this), amount);

    // send ETH to target
    (bool sent, bytes memory data) = target.call{value: amount}("");
    require(sent, "Failed to send Ether");
  }

  function approve(address spender, uint256 amount) public {
    allowed[msg.sender][spender] = amount;
  }
}
